import React, { Fragment } from "react";
import { Nav, Navbar } from "react-bootstrap";
import { Link } from "react-router-dom";

// import LinkedInIcon from "@material-ui/icons/LinkedIn";
// import GitHubIcon from "@material-ui/icons/GitHub";
// import AlternateEmailIcon from "@material-ui/icons/AlternateEmail";
// import LocalPhoneIcon from "@material-ui/icons/LocalPhone";

const NavigationBar = () => {
    return (
      <nav className="navbar" > 
          <ul className="logo-links"> 
          <li>
            <Link to="/website" activeClassName="currentlyOn"> TravelBuddy </Link>{" "}
        </li>            

    </ul> 



        <ul className="nav-links">

        <li>
            <Link to="/website" activeClassName="currentlyOn">English(UK) </Link>{" "}
        </li>

          <li>
            <Link to="/website" activeClassName="currentlyOn">
              Loyalty
            </Link>{" "}
          </li>
          <li className="nav-links-projects">
            <Link to="/projects">Manage</Link>
          </li>
          <li>
            <a
              href="https://www.keepandshare.com/doc7/62364/resume-of-glendon-1-pdf-38k?da=y"
              target="_blank"
            >
              Login
            </a>
          </li>
          <li className="nav-links-contact">
            <Link to="/contact"> Join Free</Link>
          </li>
        </ul>




        <Fragment>
          <ul className="navbar-logo">
            <li>
              <a href="https://www.linkedin.com/in/glendonthaiw/">
                {" "}
                {/* <LinkedInIcon fontSize="medium" />{" "} */}
              </a>
            </li>

            <li>
              <a href="https://github.com/glendont">
                {" "}
                {/* <GitHubIcon fontSize="small" />{" "} */}
              </a>
            </li>

            <li>
              <a href="mailto:glendon888@gmail.com">
                {" "}
                {/* <AlternateEmailIcon fontSize="medium" />{" "} */}
              </a>
            </li>

            <li>
              <a href="/contact">
                {" "}
                {/* <LocalPhoneIcon fontSize="medium" />{" "} */}
              </a>
            </li>
          </ul>
        </Fragment>
      </nav>
    );
  };

  export default NavigationBar;
